HAY RECETA DULCE 🤤🤤🤤
💥 MOUSSE DE CAFÉ Y CHOCOLATE 💣
Es una receta bastante sencilla y rápida.
Por lo visto hay faltante de queso mascarpone 🤦🏽‍♂️
Cosas que pasan ... la receta original lleva mascarpone, no lo pude conseguir 🤷🏽‍♂️.
Lo reemplace por queso tipo Finlandia 
El café debe ser fuerte y si pueden evitar el instantáneo genial ☕
El chocolate de al menos 60 % de cacao, en lo posible 🍫
Rinde 4 porciones 

INGREDIENTES 
[ ] 100 gr de chocolate semi amargo
[ ] 125 gr de queso mascarpone o sustituto
[ ] 2 cucharadas de azúcar impalpable 
[ ] 4 cucharadas de café fuerte frío
[ ] 150 ml de crema 
PROCEDIMIENTO 
[ ] Corta el chocolate en cubitos (reserva un poquito para decorar) y derretilo a baño María, cuando quede uniforme correlo del fuego y déjalo enfriar 
[ ] Mezcla el queso y el azúcar hasta que se integren bien, agrega el café frío, y después el chocolate derretido apenas tibio.
[ ] En otro bowl bati la crema, reserva un poquito para decorar.
[ ] Agregá la crema a la mezcla y uni con movimientos envolventes, no lo tenes que batir, sino integrarlo. Con delicadeza ☝️
[ ] Llévalo a copas, tazas de café o lo que uses y a la heladera al menos por 2 horas 
[ ] Antes de servirlo podes agregarle un toque de crema y chocolate rallado para decorar 
ESPERO QUE TE GUSTE MUCHO ESTA MOUSSE 
Buen fin de semana 
Saludos 
Gastón 👨🏽‍🍳

